export default function PartnerReq(props)
{
    const {requestList,acceptPartner, acceptRef} = props;
    const [viewList,setViewList] = useState(false);

    return<div className="req-list-div">
        <IconButton style={{color:"whitesmoke"}} onClick={()=>setViewList(!viewList)}><PeopleAltIcon/></IconButton>
        {viewList&&<RequestInfo/>}
    </div>
}
